    component: HomeView
  },
  {
    path: '/addContest',
    name: 'addContest',
    component: AddContestView,
  },
  {
    path: '/addQuestion/:contestId',
    name: 'addQuestion',
    component: AddQuestionView,
  },
  {
    path: '/register',
    name: 'register',
    component: RegisterView,
  },
  {
    path: '/login',
    name: 'login',
    component: LoginView,
  },
